import React from 'react';
import { Link } from 'react-router-dom';
import GoogleAuth from './GoogleAuth';

export default function Header() {
	return (
		<div className='ui secondary pointing menu'>
			<div className=''>
				<Link to='/' className='item'>
					Stream
				</Link>
				<div className='right'>
					<Link to='/' className='item'>
						All Streams
					</Link>
					<GoogleAuth />
				</div>
			</div>
		</div>
	);
}
